//******************************************
//****** DetailsPage *************************
//******************************************

import React,{useState,useEffect} from 'react';
import PropTypes from 'prop-types';

const DetailsPage = (props) => {
    const [data,setData] = useState([]);

    useEffect(()=>{  
    if(props.location.state.key){
        fetch(`https://jsonplaceholder.typicode.com/users?id=${props.location.state.key}`,{
            method:"GET",
        }).then((response)=>{
            return response.json()
        }).then((body)=>{
            console.log(body)
            setData(body)
        })
    }
    },[])


    return (

        <div>                        <table >
                                <thead>
                                    <tr>
                                        <th>
                                            Id
                                        </th>
                                        <th>
                                            Posted Profile
                                        </th>
                                        <th>
                                            Applicants
                                        </th>
                                        <th>
                                            Accepted Applicants
                                        </th>
                                        <th>
                                            Actions
                                     </th>
                                    </tr>
                                </thead>
                                <tbody>
                                {data.map((data)=>{
                                    <tr>
                                        <td>
                                            {data.id}
                                        </td>
                                    </tr>
                                })}
                                </tbody>
                                </table>


            {/* <tr>
           {data.map((data)=>{
        //    return <li key={data.id}>{data.name} - {data.phone} - {data.email} - {data.website}</li>;      
        return <li key={data.id}>{data.address.street}</li>;        
           })}
  </tr> */}
        </div>

    );
};

DetailsPage.propTypes = {};

export default DetailsPage;
